package String;

public class NumberOfWaysToSplit {

    public int numWays(String s) {
        long count = 0;
        for (char ch : s.toCharArray()) {
            count += ch - '0';
        }

        if (count == 0) {
            return (int) ((s.length() - 2) * (s.length() - 1) / 2);
        }

        if (count % 3 != 0) {
            return 0;
        }

        int firstSet = 0;
        int secondSet = 0;
        count /= 3;
        long temp = 0;

        for (char ch : s.toCharArray()) {
            temp += ch - '0';
            if (temp == count) {
                firstSet++;
            }

            if (temp == count * 2) {
                secondSet++;
            }
        }

        return firstSet * secondSet;
    }

    public static void main(String[] args) {
        NumberOfWaysToSplit ob = new NumberOfWaysToSplit();
        System.out.println(ob.numWays(
                ""));
    }
}
